// src/components/TechButton.jsx

import React from "react";

const TechButton = ({ label, color, onClick }) => {
  return (
    <button
      onClick={onClick}
      className={`p-4 m-2 rounded text-white font-semibold`}
      style={{ backgroundColor: color }}
    >
      {label}
    </button>
  );
};

export default TechButton;
